import React from 'react'
import {Card, Avatar, Button, Tooltip, Icon} from 'antd'
import {Link} from 'react-router-dom'
import * as jsPDF from 'jspdf'


// const vid = "https://firebasestorage.googleapis.com/v0/b/cursosonline-4b11c.appspot.com/o/courses%2Fanimations-css%2Fmodule1%2FAnimaciones3.1.mp4?alt=media&token=2ef60c65-f2c3-4d6d-ab88-5e769c5ababb"

//const img = "http://cssdude.com/wp-content/uploads/2016/07/css3animation.jpg"
//const img = "https://www.balticstorm.org/b/2018/09/random-pattern-generator-tile-18-background-css-pattern-generators.jpg"
import img from "../../assets/banner.png"


class CourseCard extends React.Component{

    state = {
        user:null,
        disabled:true
    }

    componentWillMount(){
        const user = JSON.parse(localStorage.getItem('user'))
        const disabled = !user.approved
        this.setState({user, disabled})
    }

    pdf = () => {
        //var imgData = 'data:image/jpeg;base64,';
        var imgData = 'data:image/png;base64,'
       
        const doc = new jsPDF({
            orientation: 'landscape',
            //unit: 'in',
            //format: [4, 2]
          });

        doc.setFontSize(40);
        //doc.addImage(imgData, 'JPEG', 15, 40, 180, 180);
        doc.addImage(imgData, 'JPEG', 0, 0, 298, 210);
        const text = this.state.user.firstName + " " + this.state.user.lastName
        doc.setFont("Helvetica");
        doc.setFontType("normal");
        //doc.setFontType("normal");
        doc.text(150, 90, text, null, null, 'center');
        doc.save()
        // Set the document to automatically print via JS
        doc.autoPrint()
    }


    render(){
        const {disabled} = this.state
        const {id=0,slug="animaciones-css",title="ANIMACIONES CON HTML, CSS Y JAVASCRIPT"} = this.props
    return(
        <div style={{flex:1}} >
        
            
                <Card 
                    cover={<img style={{filter:"grayscale(100%)"}} src={img} alt="css" />}
                    hoverable
                    style={{
                        cursor:"pointer",
                        marginLeft:20
                        }}
                    title={title}
                    extra={<div><Icon type="link" /> 
                        <div className="fb-share-button" data-href="https://learning.ironhack.com.mx" data-layout="button" data-size="large" data-mobile-iframe="true"><a rel="noopener noreferrer" target="_blank" href="https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Flearning.ironhack.com.mx%2F&amp;src=sdkpreparse" className="fb-xfbml-parse-ignore" hashtag="#IronhackMEX" >Compartir</a></div>
                     </div>}
                >
                <div>
                <strong>
                Aprenderás a crear animaciones solo con css. Utilizaremos atributos básicos como transition para animaciones básicas hasta crear keyframes para crear animaciones reutilizables 2D y 3D, también aprenderás a utilizar JavaScript en conjunto de CSS para crear animaciones más complejas y crear interactividad con el usuario. También entenderás cómo usar jQuery de una manera amena y sencilla.
                Como contenido bonus aprenderás qué es una imágen SVG. Crearemos una a mano para explorar esta tecnología y la manipularás con CSS para crear animaciones increíbles para tus proyectos.
                </strong>
                </div>

                <p style={{textAlign:"center", marginTop:50, width:200}}>
                    <Avatar src="https://miro.medium.com/fit/c/240/240/0*jp3IFb08Sy3_k3N_." />
                    <span style={{marginLeft:20}} >By: Héctor BlisS</span>
                </p>
                {/* <video width="100" src={vid}></video> */}
                
                <Link to={`/course/${id}/${slug}`}>
                <Button
                    type="primary"
                    style={{float:'right'}}
                >
                    Iniciar el curso
                </Button>
                </Link>
                { disabled ? <Tooltip title="Recuerda que para descargar tu certificado, primero debes aprobar el examen">
                    <Button
                    disabled 
                    // onClick={this.pdf}
                        >
                        Descargar Certificado
                    </Button>
                    <Link to="/exam/animations">
                        <Button type="dashed" >Resolver el examen</Button>
                    </Link>
                </Tooltip>
                :
                <Button
                // disabled
                // style={{float:'right'}}
                onClick={this.pdf} >
                    Descargar Certificado
                </Button>
                }
                
                </Card>
                
          
        </div>
    )
}
}

export default CourseCard